import React from 'react';
import Base from '../core/Base'
import { isAuthenticated } from '../auth/helper';
import { Link } from 'react-router-dom'


const AdminDashBoard = () => {
  const { user: { name, email, role } } = isAuthenticated();
  const leftAdmin = () => {
    return (
      <div className="card">
        <h4 className="text-white bg-dark card-header">Admin Navigation</h4>
        <ul className="list-group">
          <li className="list-group-item">
            <Link className="nav-link text-success" to='/admin/create/createcategory'>
              Create Category
             </Link>
          </li>
          <li className="list-group-item">
            <Link className="nav-link text-success" to='/admin/create/createproduct'>
              Create Products
             </Link>
          </li>
          <li className="list-group-item">
            <Link className="nav-link text-success" to='/admin/products'>
              Manage Product
             </Link>
          </li>
          <li className="list-group-item">
            <Link className="nav-link text-success" to='/admin/orders'>
              Manage Order
             </Link>
          </li>
        </ul>
      </div>
    )

  }
  const rightAdmin = () => {

  }
  return (
    <Base title="Welcome To Admin" description="Manage products here"
      className="container bg-success p-4">
      <div className="row">
        <div className="col-3">
          {leftAdmin()}
        </div>
        <div className="col-5">
          {rightAdmin()}
        </div>
      </div>


    </Base>
  )

}

export default AdminDashBoard;
